import logo from './logo.svg';
import './App.css';
import VocabCard from './VocabCard';
import { VocabWords } from './Vocab';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <VocabCard characters="はい" romaji="hai" part="interjection" meaning="yes"/>

        {Object.values(VocabWords).map(vocabWord =>(
            <VocabCard characters={vocabWord.characters} romaji={vocabWord.romaji} part={vocabWord.part} meaning={vocabWord.meaning}/>
        ))}
      </header>
    </div>
  );
}

export default App;
